700932.text:
장비 인챈트는 룬과 마나를 소모하여 새로운 장비 태그를 생성합니다.

태그는 총 15종류가 있으며, 각 부위마다 생성되는 태그의 종류가 다릅니다. 태그의 생성 확률은 모두 동일하며, 각 부위에 서로 다른 태그가 나올 확률은 아래와 같습니다;
무기 <color=#EA0000>9.09%</color>, 방어구 <color=#EA0000>11.11%</color>, 장신구 <color=#EA0000>7.69%</color>;

<color=#57DDEA>무기에는 11종의 태그가 생성됩니다: </color>치명타율, 치명타 피해, 공격, 공격 비율, 물리 피해 증가, 마법 피해 증가, HP, HP 비율, 마법 방어, 물리 방어, 치유량;

<color=#57DDEA>방어구에는 9종의 태그가 생성됩니다: </color>마법 방어, 마법 방어 비율, 마법 피해 감소, 물리 방어, 물리 방어 비율, 물리 피해 감소, HP, HP 비율, 공격;

<color=#57DDEA>장신구에는 13종의 태그가 생성됩니다: </color>치명타율, 치명타 피해, 공격 비율, 치유량, 마법 방어, 물리 방어, HP, HP 비율, 공격, 마법 방어 비율, 물리 방어 비율, 마법 피해 감소, 물리 피해 감소;

고급룬 사용 시 <color=#EA0000>40%</color> 확률로 신규 태그 슬롯이 오픈됩니다.

장비 인챈트는 매일 최대 999회 진행할 수 있습니다. 태그 교체 여부와 상관없이 인챈트 아이템을 1개 소모할 때마다 잔여 횟수가 1개씩 줄어듭니다. 매일 04:00에 잔여 인챈트 횟수가 초기화됩니다.
